import { type } from "@testing-library/user-event/dist/type";
import React from "react";
import ReactPlayer from "react-player";

function Train_vdo(){
    return(
       <>
       <video controls autoPlay loop muted style={{width:400,height:1000}}>
        <source src='./jindal\raighar_dashboard\src\Train_Video.mp4' type="Video.mp4" />

       </video>
       </>
    );
}
export default Train_vdo;
